tables.table_schema:
CREATE TABLE WeatherData (
    date DATE,
    temperature FLOAT,
    precipitation FLOAT,
    wind_speed FLOAT
);

CREATE TABLE YieldAnalysis (
    analysis_id INT,
    crop_name VARCHAR,
    analysis_date DATE,
    predicted_yield FLOAT
);

CREATE TABLE weather_data (
    id INT PRIMARY KEY,
    date DATE,
    temperature FLOAT,
    humidity FLOAT
);

CREATE TABLE crop_data (
    id INT PRIMARY KEY,
    crop_name VARCHAR(50),
    crop_type VARCHAR(50),
    planting_date DATE,
    harvest_date DATE
);

CREATE TABLE yield_predictions (
    id INT PRIMARY KEY,
    crop_id INT,
    prediction_date DATE,
    predicted_yield FLOAT
);

CREATE TABLE soil_data (
    id INT PRIMARY KEY,
    location VARCHAR(100),
    ph_level FLOAT,
    nutrient_levels jsonb
);
